import React, { useEffect, useState } from 'react'
import axios from 'axios';
const Books = () => {
    const [Data, setData] = useState();
    useEffect(() => {
        const fetch = async () => {
            await axios.get("http://localhost:1000/api/v1/get").then((res) => console.log(res.data.books));
        };
        fetch();
    });
    return (
        <div className='bg-dark' style={{ minHeight: "91.5vh" }}>
            <div className='d-flex justify-content-center allign-items-center my-1 py-4'>
                <h4 className='text-white'>Books Section</h4>
                {Data ? (<div className='text-white' >DATA FETCHED</div>) : (<div className='text-white'>Loading...</div>)};
            </div>
        </div>
    )
}

export default Books;
